import React from 'react';
import Layout from "../_layouts/default/Layout";

class Compositions extends React.Component {
    render() {
        return (
            <Layout {...this.props}>
                <div>
                    <h1>Compositions</h1>
                </div>
            </Layout>
        );
    }
}

export default Compositions
